"use strict";(self.webpackChunkdocusaurus_demo=self.webpackChunkdocusaurus_demo||[]).push([[9026],{4852:e=>{e.exports=JSON.parse('{"blogPosts":[{"id":"Vida Acad\xe9mica","metadata":{"permalink":"/TP3/blog/Vida Acad\xe9mica","source":"@site/blog/academico.md","title":"Vida Acad\xe9mica","description":"\\"Voc\xeas n\xe3o podem imaginar o que Jo\xe3o passou para abrir essa oficina. Lembra, pessoal, da \xe9poca da universidade? \xc9ramos todos uns jovens sonhadores, mas Jo\xe3o... Ah, ele era diferente. Desde o in\xedcio, ele tinha essa chama nos olhos, um desejo inabal\xe1vel de seguir seu caminho.\\"","date":"2023-12-27T22:09:14.000Z","formattedDate":"December 27, 2023","tags":[{"label":"dono","permalink":"/TP3/blog/tags/dono"},{"label":"hist\xf3ria","permalink":"/TP3/blog/tags/historia"},{"label":"empresa","permalink":"/TP3/blog/tags/empresa"},{"label":"premio","permalink":"/TP3/blog/tags/premio"},{"label":"servi\xe7o","permalink":"/TP3/blog/tags/servico"}],"readingTime":0.93,"hasTruncateMarker":false,"authors":[{"name":"Luis Rordrigues","title":"Diretor Executivo","imageURL":"https://cdn.discordapp.com/attachments/1049372613945851975/1189646670443585696/Exe.png?ex=659eebcc&is=658c76cc&hm=a9f7770f5540db9d7ba3018304c47f085660241bb2b5ea51eb477283c24fce4e&","key":"luis"}],"frontMatter":{"sidebar_position":4,"slug":"Vida Acad\xe9mica","title":"Vida Acad\xe9mica","authors":["luis"],"tags":["dono","hist\xf3ria","empresa","premio","servi\xe7o"]},"nextItem":{"title":"CEO","permalink":"/TP3/blog/CEO"}},"content":"\\"Voc\xeas n\xe3o podem imaginar o que Jo\xe3o passou para abrir essa oficina. Lembra, pessoal, da \xe9poca da universidade? \xc9ramos todos uns jovens sonhadores, mas Jo\xe3o... Ah, ele era diferente. Desde o in\xedcio, ele tinha essa chama nos olhos, um desejo inabal\xe1vel de seguir seu caminho.\\"\\n\\n\\"Na universidade, Jo\xe3o j\xe1 se destacava. Sempre ajudava os outros, nunca deixando ningu\xe9m para tr\xe1s. Mas a verdadeira jornada come\xe7ou quando decidimos que quer\xedamos mais do que diplomas na parede. Jo\xe3o, com sua paix\xe3o por mec\xe2nica, queria abrir uma oficina. E gente, ele n\xe3o teve medo de trabalhar por isso.\\"\\n\\n\\"Quando Jo\xe3o finalmente conseguiu abrir as portas desta oficina, foi mais do que uma realiza\xe7\xe3o pessoal. Foi a realiza\xe7\xe3o de um sonho compartilhado. E o mais incr\xedvel \xe9 que ele n\xe3o esqueceu de onde veio. Sempre se esfor\xe7a para ajudar os outros, tanto na mec\xe2nica quanto na vida.\\"\\n\\n![joaoluis](https://cdn.discordapp.com/attachments/1049372613945851975/1189642155443109958/CEOeExe.png?ex=659ee798&is=658c7298&hm=d330909ecc65899d7cb77c73d0c8e680fe8e8db19291bb80af9154ffd9ea20b0&)\\n\\n\\"A oficina de Jo\xe3o n\xe3o \xe9 apenas um lugar para consertar carros. \xc9 um s\xedmbolo de dedica\xe7\xe3o, persist\xeancia e amizade. Ele n\xe3o apenas construiu uma oficina; ele construiu um lar para todos n\xf3s.\\" - Luis Rodrigues\\n\\n<button onClick={() => alert(\'Obrigado pelo Like!\')}>Like!</button>"},{"id":"CEO","metadata":{"permalink":"/TP3/blog/CEO","source":"@site/blog/dono.md","title":"CEO","description":"Jo\xe3o Pedro: O Vision\xe1rio por Tr\xe1s da WINRAR","date":"2023-12-27T22:09:14.000Z","formattedDate":"December 27, 2023","tags":[{"label":"dono","permalink":"/TP3/blog/tags/dono"},{"label":"hist\xf3ria","permalink":"/TP3/blog/tags/historia"}],"readingTime":1.41,"hasTruncateMarker":false,"authors":[{"name":"Jo\xe3o Pedro","title":"CEO das Oficinas WINRAR","imageURL":"https://cdn.discordapp.com/attachments/1049372613945851975/1189642153136226314/CEO.png?ex=659ee797&is=658c7297&hm=13f074f9bf250f55fe8aa506a066e16c6267feede2ea72848dded30846dbd0fd&","key":"joao"}],"frontMatter":{"sidebar_position":1,"slug":"CEO","title":"CEO","authors":["joao"],"tags":["dono","hist\xf3ria"]},"prevItem":{"title":"Vida Acad\xe9mica","permalink":"/TP3/blog/Vida Acad\xe9mica"},"nextItem":{"title":"Hist\xf3ria da Empresa","permalink":"/TP3/blog/Hist\xf3ria da Empresa"}},"content":"## Jo\xe3o Pedro: O Vision\xe1rio por Tr\xe1s da WINRAR\\n![joao](https://cdn.discordapp.com/attachments/1049372613945851975/1189647128641941665/perfilCEO.png?ex=659eec3a&is=658c773a&hm=58e8fc9f1dbe41736803ab734555b47fd257ee7d802c311a0bad0678a4372e31&)\\n\\nJo\xe3o Pedro, o fundador e mente vision\xe1ria por tr\xe1s da WINRAR, nascido a 15 de Julho de 1980\\niniciou a sua jornada empreendedora em 2005 com uma vis\xe3o \xfanica para o setor automotivo. Ao longo dos anos, ele liderou a expans\xe3o da empresa, enfrentando desafios econ\xf4micos com criatividade e mantendo um compromisso inabal\xe1vel com a qualidade. \\n<br />\\nEm 2007 com a sua primeira oficina inaugurada tudo mudou. Jo\xe3o foi conseguindo estabelecer clientes leais, o que gerou uma maior reputa\xe7\xe3o. \\nFinalmente em 2010 Jo\xe3o decidiu abrir mais 2 oficinas em pontos estrat\xe9gicos. Foi aqui que Jo\xe3o percebeu o impacto que estava a ter.\\nAtualmente, Jo\xe3o possui 9 oficinas, sendo a \xfaltima inaugurada ainda este ano (2023).\\n<br />\\nJo\xe3o transformou a WINRAR em uma refer\xeancia regional e nacional, em servi\xe7os automotivos. A busca pela inova\xe7\xe3o, responsabilidade social e \\npaix\xe3o pelo mundo automotivo moldaram n\xe3o apenas a sua carreira, mas tamb\xe9m o sucesso duradouro da WINRAR.\\n<br />\\nComo l\xedder, Jo\xe3o cultiva uma cultura empresarial baseada no respeito m\xfatuo, na valoriza\xe7\xe3o dos colaboradores e no est\xedmulo \xe0 criatividade.\\nSua vis\xe3o de longo prazo n\xe3o se limita apenas ao crescimento da WINRAR, mas tamb\xe9m \xe0 constru\xe7\xe3o de um legado sustent\xe1vel e socialmente respons\xe1vel.\\nO sucesso de Jo\xe3o Pedro como empreendedor n\xe3o \xe9 apenas uma hist\xf3ria de triunfo comercial, mas um testemunho, dedica\xe7\xe3o e um profundo amor pelo que faz.\\n\\n![UALG](https://cdn.discordapp.com/attachments/722820894342381688/1189691329136033894/Design_sem_nome_1.png?ex=659f1564&is=658ca064&hm=761dd8d57cd6322f1fea70173ea3be4348260b2fe039a99d1033fc2ea10b0425&)\\n\\n## Certifica\xe7\xf5es Acad\xe9micas\\n\\n+ Mestrado em Engenharia Mec\xe2nica:\\n\\n+ Mestrado em Tecnologia Automotiva:\\n\\n+ Mestrado em Sistemas de Controle e Diagn\xf3stico de Ve\xedculos\\n\\n+ Licenciatura Gest\xe3o da Ind\xfastria Automotiva\\n\\n+ Licenciatura de Engenharia de Energias Renov\xe1veis para Transportes\\n\\n<button onClick={() => alert(\'Obrigado pelo Like!\')}>Like!</button>"},{"id":"Hist\xf3ria da Empresa","metadata":{"permalink":"/TP3/blog/Hist\xf3ria da Empresa","source":"@site/blog/historia.md","title":"Hist\xf3ria da Empresa","description":"A Oficina WINRAR, reconhecida na comunidade local e vai al\xe9m de ser um simples local para reparos automotivos. Ela representa uma hist\xf3ria de paix\xe3o, dedica\xe7\xe3o e um servi\xe7o excepcional.","date":"2023-12-27T22:09:14.000Z","formattedDate":"December 27, 2023","tags":[{"label":"dono","permalink":"/TP3/blog/tags/dono"},{"label":"hist\xf3ria","permalink":"/TP3/blog/tags/historia"},{"label":"empresa","permalink":"/TP3/blog/tags/empresa"}],"readingTime":0.54,"hasTruncateMarker":false,"authors":[{"name":"Jo\xe3o Pedro","title":"CEO das Oficinas WINRAR","imageURL":"https://cdn.discordapp.com/attachments/1049372613945851975/1189642153136226314/CEO.png?ex=659ee797&is=658c7297&hm=13f074f9bf250f55fe8aa506a066e16c6267feede2ea72848dded30846dbd0fd&","key":"joao"}],"frontMatter":{"sidebar_position":2,"slug":"Hist\xf3ria da Empresa","title":"Hist\xf3ria da Empresa","authors":["joao"],"tags":["dono","hist\xf3ria","empresa"]},"prevItem":{"title":"CEO","permalink":"/TP3/blog/CEO"},"nextItem":{"title":"Pr\xeamio 2023","permalink":"/TP3/blog/Pr\xeamio 2023"}},"content":"A Oficina WINRAR, reconhecida na comunidade local e vai al\xe9m de ser um simples local para reparos automotivos. Ela representa uma hist\xf3ria de paix\xe3o, dedica\xe7\xe3o e um servi\xe7o excepcional.\\n\\nAs nossas oficinas n\xe3o s\xe3o apenas um lugar para consertar veiculos, s\xe3o bespa\xe7os onde os clientes se sentem bem-vindos e valorizados. As Oficinas WINRAR adototaram uma abordagem transparente e educativa, explicando cada reparo de forma clara e garantindo que os clientes compreendessem a import\xe2ncia da manuten\xe7\xe3o preventiva.\\n\\n Tamb\xe9m prestamos aten\xe7\xe3o \xe0s mudan\xe7as na ind\xfastria automotiva. Investimo em treino cont\xednuo para os nossos mec\xe2nicos, especialmente em tecnologias emergentes, como ve\xedculos el\xe9tricos e h\xedbridos.\\n\\n![imagemmecanicocartoon](https://cdn.discordapp.com/attachments/1049372613945851975/1188091546235584543/3.png?ex=6599437a&is=6586ce7a&hm=251674c13355b56913d0853137b6037e73b591dc574247777df79339ac1e6ad1&)\\n\\n<button onClick={() => alert(\'Obrigado pelo Like!\')}>Like!</button>"},{"id":"Pr\xeamio 2023","metadata":{"permalink":"/TP3/blog/Pr\xeamio 2023","source":"@site/blog/trofeu.md","title":"Pr\xeamio 2023","description":"Oficina WINRAR Recebe Prestigioso Pr\xeamio de Excel\xeancia em Servi\xe7os Automotivos","date":"2023-12-27T22:09:14.000Z","formattedDate":"December 27, 2023","tags":[{"label":"dono","permalink":"/TP3/blog/tags/dono"},{"label":"hist\xf3ria","permalink":"/TP3/blog/tags/historia"},{"label":"empresa","permalink":"/TP3/blog/tags/empresa"},{"label":"premio","permalink":"/TP3/blog/tags/premio"},{"label":"servi\xe7o","permalink":"/TP3/blog/tags/servico"}],"readingTime":0.49,"hasTruncateMarker":false,"authors":[{"name":"Jo\xe3o Pedro","title":"CEO das Oficinas WINRAR","imageURL":"https://cdn.discordapp.com/attachments/1049372613945851975/1189642153136226314/CEO.png?ex=659ee797&is=658c7297&hm=13f074f9bf250f55fe8aa506a066e16c6267feede2ea72848dded30846dbd0fd&","key":"joao"},{"name":"Luis Rordrigues","title":"Diretor Executivo","imageURL":"https://cdn.discordapp.com/attachments/1049372613945851975/1189646670443585696/Exe.png?ex=659eebcc&is=658c76cc&hm=a9f7770f5540db9d7ba3018304c47f085660241bb2b5ea51eb477283c24fce4e&","key":"luis"}],"frontMatter":{"sidebar_position":3,"slug":"Pr\xeamio 2023","title":"Pr\xeamio 2023","authors":["joao","luis"],"tags":["dono","hist\xf3ria","empresa","premio","pr\xeamio","servi\xe7o"]},"prevItem":{"title":"Hist\xf3ria da Empresa","permalink":"/TP3/blog/Hist\xf3ria da Empresa"}},"content":"Oficina WINRAR Recebe Prestigioso Pr\xeamio de Excel\xeancia em Servi\xe7os Automotivos\\n\\nVila Automotiva, 26 de Fevereiro de 2023\\n\\nNa \xfaltima sexta-feira, a Oficina WINRAR, dirigida pelo dedicado mec\xe2nico Jo\xe3o Silva, foi agraciada com o prestigioso Pr\xeamio de Excel\xeancia em Servi\xe7os Automotivos, reconhecendo a oficina como um padr\xe3o de qualidade e atendimento exemplar na comunidade local.\\n\\nO pr\xeamio, concedido pela Associa\xe7\xe3o Nacional de Mec\xe2nicos e Oficinas (ANMO), destaca a not\xe1vel contribui\xe7\xe3o da Oficina WINRAR para a ind\xfastria automotiva, reconhecendo sua abordagem excepcional em termos de servi\xe7os mec\xe2nicos, atendimento ao cliente e inova\xe7\xe3o tecnol\xf3gica.\\n\\n![trofeu1](https://www.freeiconspng.com/thumbs/trophy-png/trophy-png-14.png)\\n\\n<button onClick={() => alert(\'Obrigado pelo Like!\')}>Like!</button>"}]}')}}]);